import './NavBar.css'
import { Link } from 'react-router-dom';
import { useState } from 'react';

const styles = {
    currentPage: {
        backgroundColor: "#2da9ad",
        borderRadius: "12px",
        paddingTop: '10px,',
        paddingBottom: '10px',
    },
}
function NavBar() {
    const [location, setLocation] = useState(window.location.pathname)

    return (
        <div id="nav-container">
            <nav id="navBar">
                <div className="ul-cont">
                    <ul id="navLi-container">
                        <li className="nav-li">
                            <Link to="/" className='link-style'>Home</Link>
                        </li>
                        <li className="nav-li">
                            <Link to="/projects" className='link-style'>Projects</Link>
                        </li>
                        <li className="nav-li">
                            <Link to="/app" className='link-style'>App</Link>
                        </li>
                        <li className="nav-li">
                            <Link to="/others" className='link-style'>Others</Link>
                        </li>
                    </ul>
                </div>
            </nav>
        </div>
    );
}

export default NavBar;
